import { makeStyles, styled } from '@mui/styles';
import homePagePicture from './picture/homePageLastVersion.jpg'
import Grid from '@mui/material/Grid'
import { Paper, Typography } from '@mui/material';
import Card from '@mui/material/Card';
import Box from '@mui/material/Box';
import CssBaseline from '@mui/material/CssBaseline';
import { alpha } from '@mui/material/styles';
import './css/accueilCss.css'

const themeHomePage = createTheme({
    lol: {
        minHeight: '88vh',
        backgroundImage: `url(${homePagePicture})`,
        backgroundRepeat: 'no-repeat',
        backgroundSize: "cover",
        backgroundPosition: "center center",
        backgroundAttachment: "fixed",
        maxHeight: '95%'
    }
})  
const useStyles = makeStyles((theme) => ({
    Typography: {
    root: {
        minHeight: '88vh',
        backgroundImage: `url(${homePagePicture})`,
        backgroundRepeat: 'no-repeat',
        backgroundSize: "cover",
        backgroundPosition: "center center",
        backgroundAttachment: "fixed",
        maxHeight: '95%'
    }
}
}))

const HomePageMui = () => {
    const classes= useStyles();
    return(
        <ThemeProvider theme={themeHomePage}>
                <Grid container alignItems="center" justify="center">
                        <Grid item xs={12}>
                            <Typography variant="root">
                                <img src={homePagePicture}/>
                            </Typography>

                        </Grid>
                </Grid>
        </ThemeProvider>
    )
}

export default HomePageMui
